import React from 'react'
import arrow from '../Img/Partners/arrow.png'

export const OrangeButton = ({text, valid}) => {
  return (
    <button className={!valid ? 'orange-button' : 'orange-button disbled'}>
        <p className='orange-button-text'>{text}</p>
        <img src={arrow}/>
    </button>
  )
}
